document: modulemd
version: 1
data:
    summary: Bootstrap the Modularity infrastructure
    description: >
        The purpose of this module is to provide a boostrapping mechanism
        for new distributions or architectures as well as the entire build
        environment for the Base Runtime module.
    license:
        module: [ MIT ]
    dependencies:
        buildrequires:
            bootstrap: master
    references:
        community: https://fedoraproject.org/wiki/BaseRuntime
        documentation: https://fedoraproject.org/wiki/BaseRuntime
        tracker: https://pagure.io/base-runtime/issues
    # The buildroot profiles need to be in sync with Base Runtime
    profiles:
        buildroot:
            rpms:
                - bash
                - bzip2
                - coreutils
                - cpio
                - diffutils
                - fedora-release
                - findutils
                - gawk
                - gcc
                - gcc-c++
                - grep
                - gzip
                - info
                - make
                - patch
                - redhat-rpm-config
                - rpm-build
                - sed
                - shadow-utils
                - tar
                - unzip
                - util-linux
                - which
                - xz
        srpm-buildroot:
            rpms:
                - bash
                - fedora-release
                - fedpkg-minimal
                - gnupg2
                - redhat-rpm-config
                - rpm-build
                - shadow-utils
